<script setup>
const props = defineProps({
  size: Number,
  color: String,
})
function getColor() {
  if (props.color) {
    return props.color
  } else return '#000000'
}
</script>

<template>
  <svg
    :width="size"
    :height="size"
    xmlns="http://www.w3.org/2000/svg"
    xmlns:xlink="http://www.w3.org/1999/xlink"
    viewBox="0 0 480 480"
    :fill="getColor()"
  >
    <image
      width="480"
      height="480"
      xlink:href="data:img/png;base64,"
    />
  </svg>
</template>

<style scoped></style>
